import Link from 'next/link';
import Head from 'next/head';
import { Layout } from '../components/Layout';

const Index =() => {
    return(
        <Layout title={'my page'}>
            <Head>
                <title>home</title>
                <meta name="description" content="My SEO React app with nextjs" />
                <meta name="keywords" content="react next seo" />
                <meta name="author" content="koji kanao" />
            </Head>
            <h2>hello world</h2>
            <Link href='/about'>
                <a>About</a>
            </Link>
            <p>
                demo text demo text demo text demo text demo text demo text demo text demo text demo text demo text
            </p>
        </Layout>
    )
}

export default Index;
